import Notification from "../../img/notification.svg"

function Navbar() {
  return (
    <div className="navbar">
      <span className="logo">App</span>
      <div className="icons">
        <div className="icon">
            <img src={Notification} alt=""/>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
